import "./App.css";
import React, { } from "react";
import Rainbow from "./components/rainbow.js";
import Taskbar from "./components/taskbar.js";

function Title() {
  return (
    <div className="center">
    <Rainbow
        type="title"
        refLink = "index.html"
        text = "JackSavini.com"
      />
    </div>
  );
}

function App() {
  return (
    <div>
      <Title/>
      <Taskbar/>
    </div>
  );
}

export default App;
